        <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">
        <html xmlns:itsnat="http://itsnat.org/itsnat" xmlns="http://www.w3.org/1999/xhtml">
        <head>
            <title>private_event_delete</title>
        </head>
        <body>
        <div class="span-14 last nty" itsnat:nocache="true" xmlns:itsnat="http://itsnat.org/itsnat">
            <hr/>
            <ul style="list-style-type:none;" class="span-14 last center">
                <li class="span-14 last black_fg">
                    <div class="span-14 last">&nbsp;</div>
                    <h3><span  id="privateEventDeleteName" class="span-14 last fg_orange bold vtip"
                            title="You can invite friends to this event.">&nbsp;</span></h3>
                </li>
                <li class="span-14 last black_fg">
                    <h4><span id="privateEventDeleteInfo" class="span-14 last fg_orange vtip"
                            title="You can invite friends to this event.">&nbsp;</span></h4>
                    <div class="span-14 last">&nbsp;</div>
                </li>
                <li class="span-14 last black_fg">
                    <span id="privateEventDeleteNotice" class="span-14 last black_fg"></span>
                    <div class="span-14 last"></div>
                </li>
               <li class="span-14 last black_fg">
                   <div class="span-2 prepend-6 append-6 last">
                        <a href="#" id="privateEventDelete" class="btn center vtip" title="You CANNOT UNDO a delete!">&nbsp;&nbsp;Delete&nbsp;&nbsp;</a>
                   </div>
               </li>
               <li class="span-14 last black_fg">
                  <div id="privateEventDeleteLink" class="prepend-5 span-4 append-5 last">
                  </div>
                  <div class="span-14 last">&nbsp;</div>
                </ li>
            </ul>
            <hr/>
        </div>
        </body>
